import React, {useState, useEffect} from 'react';
import NavBar from './NavBar';
import "../styles/StockDetails.css";
import axios from 'axios';

function StockDetails() {

  const [stocks,setStocks] = useState([])
  const [user, setUser] = useState([])
  var [username, setUsername] = useState('')

  useEffect(()=>{
    async function getuser() {
      try {
        const user = await axios.get('http://localhost:8000/login/')
        console.log(user.data[user.data.length -1 ])
        setUser(user.data[user.data.length -1])
        username = user.data[user.data.length -1]
      } catch (error) {
        console.log(error)

      }
    } getuser();
  },[])

  useEffect(()=>{
    async function getstock() {
      try {
        const stocks = await axios.get('http://localhost:8000/buy/')
        console.log(stocks.data)
        setStocks(stocks.data)
      } catch (error) {
        console.log(error)

      }
    } getstock();
  },[])





  return (
    <>
    <div className='nav'>
        <NavBar/>
    </div>
    <div className="card-container">
      {stocks.map((stock) => (
        console.log(username), 
        <div className="card" key={stock.name}>
          <div className="card-content">
            <h2>{stock.name}</h2>
            <p>Purchased Price: {stock.price}</p>
            <p>Holdings: {stock.q}</p>
          </div>
        </div>
      ))}
    </div>
    </>
  )
}

export default StockDetails
